import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { Security, LoginCallback } from '@okta/okta-react'; // Import necessary components

import oktaConfig from './oktaConfig';

ReactDOM.render(
  <React.StrictMode>
    <Security {...oktaConfig}>
      <App />
    </Security>
  </React.StrictMode>,
  document.getElementById('root')
);

// This route handles the Okta login callback
ReactDOM.render(
  <React.StrictMode>
    <Security {...oktaConfig}>
      <LoginCallback />
    </Security>
  </React.StrictMode>,
  document.getElementById('login-callback')
);

reportWebVitals();
